scriptlet.script:
a = scriptletInput;
hr = 0;
min = 0;
sec = 0;
if (a < 60)
{
sec = a;
scriptletResult  = sec + ' seconds'
}
else if( a > 60 && a < 3600 )
{
min = parseInt(a/60);
sec = a - (min*60);
scriptletResult  = min + ' Minutes ' + sec + ' seconds'
}
else
{
hr = parseInt(a/3600);
rem = a -(3600*hr);
	if( rem > 60 )
	{
	min = parseInt(rem/60);
	sec = rem -(60*min)
	}
	else 
	{
	min = 0 ;
	sec = rem;
	}
scriptletResult  = hr + ' Hours ' + min + ' Minutes ' + sec + ' seconds'
}
